import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const BoardApp = () => {
    const [posts, setPosts] = useState([]);
    const [newPost, setNewPost] = useState({ title: '', author: '' });

    useEffect(() => {
        fetchPosts();
    }, []);

    const fetchPosts = async () => {
        try {
            const response = await axios.get('https://jsonplaceholder.typicode.com/posts');
            setPosts(response.data);
        } catch (error) {
            console.error('Error fetching posts:', error);
        }
    };

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setNewPost((prevPost) => ({ ...prevPost, [name]: value }));
    };

    const addPost = async () => {
        try {
            const response = await axios.post('https://jsonplaceholder.typicode.com/posts', newPost);
            setPosts((prevPosts) => [...prevPosts, response.data]);
            setNewPost({ title: '', author: '' });
        } catch (error) {
            console.error('Error adding post:', error);
        }
    };

    const deletePost = async (postId) => {
        try {
            await axios.delete(`https://jsonplaceholder.typicode.com/posts/${postId}`);
            setPosts((prevPosts) => prevPosts.filter((post) => post.id !== postId));
        } catch (error) {
            console.error('Error deleting post:', error);
        }
    };

    return (
        <div>
            <div className="qna_path">
                <span>현재 위치</span>
                <ol>
                    <li><Link to="/">홈</Link></li>
                    <li title="현재 위치">&gt; QnA</li>
                </ol>
            </div>
            <main>
                <div className="qna_wrap">
                    <div className="qna_content">
                        <div className="qna_title">
                            <h2>QnA</h2>
                            <div class="qna_txt_01">Ojoa 문의게시판입니다.</div>
                        </div>

                        <h1>게시판</h1>
                        <table>
                            <thead>
                                <tr>
                                    <th>순서</th>
                                    <th>제목</th>
                                    <th>작성자</th>
                                    <th>수정</th>
                                    <th>삭제</th>
                                </tr>
                            </thead>
                            <tbody>
                                {posts.map((post, index) => (
                                    <tr key={post.id}>
                                        <td>{index + 1}</td>
                                        <td>{post.title}</td>
                                        <td>{post.author || '익명'}</td>
                                        <td>
                                            <button>수정</button>
                                        </td>
                                        <td>
                                            <button onClick={() => deletePost(post.id)}>삭제</button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                        <div>
                            <h2>새 게시물 추가</h2>
                            <input
                                type="text"
                                name="title"
                                placeholder="제목"
                                value={newPost.title}
                                onChange={handleInputChange}
                            />
                            <input
                                type="text"
                                name="author"
                                placeholder="작성자"
                                value={newPost.author}
                                onChange={handleInputChange}
                            />
                            <button onClick={addPost}>추가</button>
                        </div>
                    </div>

                </div>
            </main>
        </div>
    ); //return
} //Qna


export default BoardApp;
